import './App.scss';
import { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  Button, Container, Nav, Navbar, NavDropdown, Alert,
  Accordion, Card, Badge, Breadcrumb, ButtonGroup, ListGroup
} from 'react-bootstrap';
import OffcanvasReact from './Offcanvas/OffcanvasReact';
import CustomToggle from './CustomToggle/CustomToggle';
import ButtonLoading from './ButtonLoading/ButtonLoading';

function App() {


  return (
    <div className="App">
      <Nav variant="pills" defaultActiveKey="#first">
        <Nav.Item>
          <Nav.Link href="#first">Active</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link href="#link">Link</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link href="#disabled" disabled>
            Disabled
          </Nav.Link>
        </Nav.Item>
      </Nav>
      <Card className="text-center">
        <Card.Header>Featured</Card.Header>
        <Card.Body>
          <Card.Title>Triết lí sống</Card.Title>
          <Card.Text>
            Thằng ngu nào cũng cho mình là giỏi
          </Card.Text>
          <Button variant="primary">Go somewhere</Button>
        </Card.Body>
        <Card.Footer className="text-muted">2 days ago</Card.Footer>
      </Card>
    </div>
  );
}

export default App;
